import React from "react";

export const Home = () => {
    return (
        <div className="home">
            <div className="home__greetings-wrapper">
                <p>Hello, I'm glad to see you here</p>
                <p>I hope you enjoy my work</p>
            </div>
            <p className="home__extend-info">For this task I used React, React-router, classnames</p>
        </div>
    )
}
